import { useState } from "react";
import { cities } from "./orase"; // Ensure you have this file with the list of cities

const SearchForm = ({ onSubmit }) => {
  const [formValues, setFormValues] = useState({
    name: "",
    surname: "",
    idnp: "",
    email: "",
    phoneNumber: "",
    city: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formValues);
    // Reset form values after submission
    setFormValues({
      name: "",
      surname: "",
      idnp: "",
      email: "",
      phoneNumber: "",
      city: "",
    });
  };

  return (
    <form onSubmit={handleSubmit} style={formStyle}>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>Nume</label>
        <input
          type="text"
          name="name"
          value={formValues.name}
          onChange={handleChange}
          style={inputStyle}
          placeholder="AdaugÄƒ nume"
        />
      </div>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>Nume de familie</label>
        <input
          type="text"
          name="surname"
          value={formValues.surname}
          onChange={handleChange}
          style={inputStyle}
          placeholder="AdaugÄƒ nume de familie"
        />
      </div>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>IDNP</label>
        <input
          type="text"
          name="idnp"
          value={formValues.idnp}
          onChange={handleChange}
          style={inputStyle}
          placeholder="AdaugÄƒ IDNP"
        />
      </div>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>Email</label>
        <input
          type="email"
          name="email"
          value={formValues.email}
          onChange={handleChange}
          style={inputStyle}
          placeholder="AdaugÄƒ email"
        />
      </div>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>NumÄƒr de telefon</label>
        <input
          type="tel"
          name="phoneNumber"
          value={formValues.phoneNumber}
          onChange={handleChange}
          style={inputStyle}
          placeholder="AdaugÄƒ numÄƒr"
        />
      </div>
      <div style={inputGroupStyle}>
        <label style={labelStyle}>OraÈ™</label>
        <select
          name="city"
          value={formValues.city}
          onChange={handleChange}
          style={{
            ...inputStyle,
            color: `${formValues.city === "" ? "#757575" : "#212121"}`,
          }}
        >
          <option
            value=""
            style={{ ...optionStyle, color: "#ccc", fontWeight: "300" }}
            disabled
          >
            Alege oraÈ™
          </option>
          {cities.map((city, index) => (
            <option key={index} value={city} style={optionStyle}>
              {city}
            </option>
          ))}
        </select>
      </div>
      <button type="submit" style={submitButtonStyle}>
        CautÄƒ
      </button>
    </form>
  );
};

const formStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "1em",
  padding: "20px",
  borderRadius: "15px",
  border: "1px solid #0073e6",
  backgroundColor: "#f0f4ff",
  boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
  maxWidth: "500px",
};

const inputGroupStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "0.5em",
};

const labelStyle = {
  fontWeight: "bold",
  color: "#0073e6",
};

const inputStyle = {
  padding: "10px",
  borderRadius: "5px",
  border: "1px solid #ccc",
  fontSize: "16px",
};

const optionStyle = {
  fontSize: "16px",
};

const submitButtonStyle = {
  padding: "10px 20px",
  borderRadius: "25px",
  border: "1px solid #0073e6",
  backgroundColor: "#0073e6",
  color: "#fff",
  fontSize: "16px",
  fontWeight: "bold",
  cursor: "pointer",
  transition: "background-color 0.3s, box-shadow 0.3s",
};

export default SearchForm;
